import React, { Component } from 'react';

class SetPlanner extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return (
            <div className="calculator">
        
            <h4>Set Planner</h4>
    
            <form noValidate autoComplete="off">
            <TextField type="number" id="sets" label="Enter number of sets" variant="outlined" 
            margin="dense" required="True" size="medium"/>
            </form>

            <form noValidate autoComplete="off">
            <TextField type="number" id="reps" label="Enter reps per set" variant="outlined" 
            margin="dense" required="True" size="medium"/>
            </form>
    
    
            <Button variant="contained" color="primary">
            Calculate
            </Button>

            </div>
        );
    }
}
 
export default SetPlanner;
